function copytext(id,success) {
      var from = document.getElementById(id);
      var range = document.createRange();

      window.getSelection().removeAllRanges();
      range.selectNode(from);

      window.getSelection().addRange(range);
      document.execCommand('copy');

      document.getElementById(success).innerHTML="Copied to Clipboard";

      wait(success);

      window.getSelection().removeAllRanges();
 }

async function wait(success) {
   await sleep(1000);
   if(success== "copysucess1"){
     document.getElementById(success).innerHTML="Copy Account Number";
   }
   else if (success == "copysucess2") {
   document.getElementById(success).innerHTML="Copy Amount";
   }
   else {
     document.getElementById(success).innerHTML="Copy Order Number";
   }
 }

function sleep(ms) {
   return new Promise(resolve => setTimeout(resolve, ms));
 }


